import React, {useState} from "react";
import { Form, Input, FormField, Rating} from "semantic-ui-react";

export const MovieForm = () => {
    const [title, setTitle] = useState('');
    const [rating, setRating] = useState(1);

    return (
        <Form>
            <FormField>
                <Input 
                placeholder="Movie title" 
                value={title} 
                onChange={e => setTitle(e.target.value)}/>
            </FormField>

            <FormField>
                <Rating 
                icon='star' 
                value={rating}
                maxRating={5}
                onRate={(_, data) => {
                    console.log(data)
                }}/>
            </FormField>
        </Form>
    );
};
